# Parse the HTML table with BeautifulSoup
soup = BeautifulSoup(html, 'html.parser')
print("HTML table parsed")

# Find all relevant table rows
rows = soup.find_all('td', {'style': 'width: 50%;padding-right:15px'})
print(f"{len(rows)} table rows found")

# Extract the University, Address, and URL from each row
data = []
for row in rows:
    university = row.find('h3').text.strip()
    address_tags = row.find_all('br')
    if address_tags:
        address = ''
        for tag in address_tags[1:]:
            if tag.string:
                address += tag.string.strip()
    else:
        address = ''
    url = row.find('a')
    url = url['href'] if url is not None else ''
    data.append([university, address, url])
print("Data extraction complete")

# Write the data to a CSV file
with open('output.csv', 'w', newline='') as csvfile:
    writer = csv.writer(csvfile)
    writer.writerow(['University', 'Address', 'URL'])
    writer.writerows(data)
print("CSV file written")
